import React,{useState} from 'react';

import logo from './logo.svg';
import './App.css';

function App() {

  var [state, setstate] = useState({
    search: ""
  });
  var handleTyping = (e) => {
    console.log(e.target.value,"this e")
    console.log("typing")
    setstate({

      ...state,search: e.target.value
    }) 

  } 
  return (
    <div className="App">
      <input onChange={handleTyping}/>
      <button>Search</button>
    </div>
  );
}

export default App;
